const autor = () => {
    return {
        type: 'AUTOR'
    }
}

const like = () => {
    return {
        type: 'LIKE'
    }
}

const login = () => {
    return {
        type: 'LOGIN'
    }
}

const logout = () => {
    return {
        type: 'LOGOUT'
    }
}

const addUser = (user) => {
    return {
        type: 'NEW_USER',
        payload: user
    }

}

export {
    autor,
    like,
    login,
    logout,
    addUser
}
